import React from 'react'
import Revenue from './Card_assets/Icon_1.png'
import ATM from './Card_assets/ATM_card.png'

const Vcard = ({codes}) => {
    
  return (
    <div class='basis-1/2 flex p-4 pl-4 justify-center'>
        <img src={Revenue} alt="revenue" class=' w-10 h-10 '></img>
       <div class='ml-2'> <div class='text-sm font-bold'>{codes.num}</div>
        <div class='text-xs '>{codes.text}</div></div>
    </div>
  )
}

const Acard =() =>{
  return(
    <div>
    <img src={ATM} alt="ATM Card"></img>
    <p>This month</p>
    <p>$16,982.20</p>
    <progress value={0.5} />
    </div>
  )
}

export default Vcard
